import React from "react";
import "./All.css"
import Navbar from "../Component/Navbar";
import icon from "../Resimler/Süperlig_logo.png"


const TakımEkle = () => {
    return (
        <div>
            <Navbar />
            <div className="Takım_cerceve">
                <div className="Takım_cerceve_iç">
                    <div className="orta">
                        <img src={icon} width="40" />
                    <h3>Takım Ekleme</h3>

                    </div>
                    <p><input type="text"  /></p>

                </div>

            </div>
        </div>
    )
}

export default TakımEkle;
